import axios from "axios";
import { ref } from "vue";

export default function backend(url) {
  const apiUrl = 'http://localhost:8000/api/';
  const apiData = ref();

  const apiCall = async () => {
    const response = await fetch(apiUrl+"calendar/week")
    .then((data) => data.json()).catch((error) => console.log(error))
  }
  console.log(apiCall());

  return {
    apiData
  }
}
